// ==UserScript==
// @name         NuclearNode+ Christmas theme
// @version      0.0.0
// @description  Christmas Theme for BombParty + NuclearNode+
// @author       MrInanimated
// @downloadURL  https://github.com/MrInanimated/nuclearnode-plus/raw/master/themes/nplus-christmas.user.js
// @match        http://bombparty.sparklinlabs.com/play/*
// ==/UserScript==

var executeScript = function (source) {
    var script = document.createElement("script");
    script.textContent = source;
    document.body.appendChild(script);
    document.body.removeChild(script);
};

var css = "#App{background:url('data:image/png;base64,'),radial-gradient(ellipse,#016cbe,#01266c),#016cbe;background-repeat:repeat-x;background-position:center bottom}#App>header{background:linear-gradient(to bottom,rgba(60,60,128,.4) 0,rgba(60,60,128,.4) 100%)}#App>main{border-top:0}";

var addStyleSheet = function (css) {
    var style = document.createElement("style");
    style.innerHTML = css;
    document.head.appendChild(style);
};

addStyleSheet(css);

var main = function () {

var images = {
    "http://bombparty.sparklinlabs.com/images/Arrow.png": "data:image/png;base64,",
    "http://bombparty.sparklinlabs.com/images/Bomb.png": "data:image/png;base64,",
    "http://bombparty.sparklinlabs.com/images/Heart.png": "data:image/png;base64,",
    "http://bombparty.sparklinlabs.com/images/HeartEmpty.png": "data:image/png;base64,",
};

var textStyles = {
    "statusText": {
        "color": "#ddd",
        "shadow": true
    },
    "promptText": {
        "shadow": true
    },
    "wordText": {
        "color": "#c0c0c0",
        "shadow": true
    },
    "highlightedText": {
        "color": "#80cc80",
        "shadow": true
    },
    "bonusLetterText": {
        "color": "#335"
    },
};

var particles = {
    images: [
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
    ],
    spawnChance: 0.025,
};

var christmas = function () {
    var canvas = $("#GameCanvas")[0];
    var ctx = canvas.getContext("2d");

    // Monkey patch drawImage
    var oldDrawImage = ctx.drawImage;
    ctx.drawImage = function () {
        var image = arguments[0];
        if (images[image.src]) {
            image.src = images[image.src];
        }

        return oldDrawImage.apply(this, arguments);
    };

    var detectTextStyle = function () {
        var textColor = ctx.fillStyle;

        switch (textColor) {
            case "#cccccc":
                return "statusText";
            case "#ffffff":
                return "promptText";
            case "#a0a0a0":
                return "wordText";
            case "#60aa60":
                return "highlightedText";
            case "#404040":
                return "bonusLetterText";
        }
    };

    var oldFillText = ctx.fillText;
    ctx.fillText = function () {
        ctx.save();

        var font = ctx.font.split("px ");
        var fontSize = font[0];
        var fontFamily = font[1];

        var style = detectTextStyle();
        if (textStyles[style]) {
            var newStyle = textStyles[style];
            if (newStyle.color) {
                ctx.fillStyle = newStyle.color;
            }
            if (newStyle.shadow) {
                if (typeof newStyle.shadow === "string")
                    ctx.shadowColor = newStyle.shadow;
                else
                    ctx.shadowColor = "#000";
                ctx.shadowBlur = 10;
            }

            var newFont = [fontSize, fontFamily];
            if (style == "wordText" || style == "highlightedText") {
                if (fontSize == "20" && newStyle.majorFontSize) {
                    newFont[0] = newStyle.majorFontSize;
                }
                else if (fontSize == "14" && newStyle.minorFontSize) {
                    newFont[0] = newStyle.minorFontSize;
                }
            }
            else if (newStyle.fontSize) {
                newFont[0] = newStyle.fontSize;
            }

            if (newStyle.fontFamily) {
                newFont[1] = newStyle.fontFamily;
            }

            ctx.font = newFont.join("px ");
        }

        oldFillText.apply(this, arguments);

        ctx.restore();
    };

    var oldMeasureText = ctx.measureText;
    ctx.measureText = function () {
        ctx.save();

        var font = ctx.font.split("px ");
        var fontSize = font[0];
        var fontFamily = font[1];

        var style = detectTextStyle();
        if (textStyles[style]) {
            var newStyle = textStyles[style];

            var newFont = [fontSize, fontFamily];
            if (style == "wordText" || style == "highlightedText") {
                if (fontSize == "20" && newStyle.majorFontSize) {
                    newFont[0] = newStyle.majorFontSize;
                }
                else if (fontSize == "14" && newStyle.minorFontSize) {
                    newFont[0] = newStyle.minorFontSize;
                }
            }
            else if (newStyle.fontSize) {
                newFont[0] = newStyle.fontSize;
            }

            if (newStyle.fontFamily) {
                newFont[1] = newStyle.fontFamily;
            }

            ctx.font = newFont.join("px ");
        }

        var result = oldMeasureText.apply(this, arguments);

        ctx.restore();

        return result;
    };

    var particleArray = [];
    var particleImgs = [];

    if (particles.images) {
        particleImgs = particles.images.map(function (i) {
            var img = new Image();
            img.src = i;
            return img;
        });
    }

    var mousePos = {
        x: 0,
        y: 0,
    };

    var prevMousePos = {
        x: 0,
        y: 0,
    };

    var mouseVel = {
        x: 0,
        y: 0,
    };

    var prevMouseVel = {
        x: 0,
        y: 0,
    };

    canvas.addEventListener("mousemove", function (e) {
        mousePos.x = (e.offsetX || e.layerX) - canvas.width/2;
        mousePos.y = (e.offsetY || e.layerY) - canvas.height/2;
    });

    var spawnParticle = function () {
        if (Math.random() < particles.spawnChance) {
            var rawSize = Math.random();

            var approx_size = (rawSize * 0.4 + 0.8) * 64 * 1.5;

            var pos_x = Math.random() * (canvas.width + 300) - 150;
            var pos_y = -approx_size;

            var vel_x = 0;
            var vel_y = 80 * rawSize + 20;

            var scale = rawSize * 0.25 + 0.5;

            var angle = Math.random() * 2 * Math.PI;
            var angleV = Math.random() * 2 - 1;

            particleArray.push({
                imageId: Math.floor(Math.random() * particleImgs.length),
                position: {
                    x: pos_x,
                    y: pos_y,
                },
                velocity: {
                    x: vel_x,
                    y: vel_y,
                },
                angle: angle,
                angleV: angleV,
                scale: scale,
                alpha: 1,
            });
        }

        requestAnimationFrame(spawnParticle);
    };

    var scoreboard = $("#NPlusDragContainer")[0];
    var scoreboardButton = $("#DragonButton")[0];
    var scoreboardRect;
    var canvasRect;
    var isPlaying;
    var isDragon;

    var isObscuring = function (x, y) {

        var canvasScale = Math.min(canvas.height / 900, 1);

        // Near the center (obscuring the prompt)
        if (Math.abs(x - canvas.width / 2) < 100 * canvasScale &&
            Math.abs(y - canvas.height / 2) < 200 * canvasScale) {
            return true;
        }

        // Obscuring locked letters
        if (isPlaying &&
            x + 32 > canvas.width - Math.min(
            100, canvas.height / 11 * 2)) {
            return true;
        }

        // Obscuring the scoreboard
        var cx = x + canvasRect.left;
        var cy = y + canvasRect.top;
        if (isDragon &&
            scoreboardRect.left - 32 < cx && cx < scoreboardRect.right + 32 &&
            scoreboardRect.top - 32 < cy && cy < scoreboardRect.bottom + 32) {
            return true;
        }

        // Obscuring a player
        for (var i = 0; i < channel.data.actors.length; i++) {
            var theta = Math.PI * 2 * i / channel.data.actors.length;
            var ax = Math.cos(theta) * 300 * canvasScale + canvas.width / 2;
            var ay = Math.sin(theta) * 300 * canvasScale + canvas.height / 2;

            if (Math.abs(x - ax) < 80 * canvasScale &&
                Math.abs(y - ay) < 160 * canvasScale) {
                return true;
            }
        }

        return false;

    };

    var lastTime = Date.now();
    var particleUpdate = function () {
        var current = Date.now();
        var dt = Math.min((current - lastTime) / 1000, 1);
        lastTime = current;

        mouseVel.x = (mousePos.x - prevMousePos.x) / dt;
        mouseVel.y = (mousePos.y - prevMousePos.y) / dt;

        var particle_acc = mouseVel.x / 400;

        prevMousePos.x = mousePos.x;
        prevMousePos.y = mousePos.y;
        prevMouseVel.x = mouseVel.x;
        prevMouseVel.y = mouseVel.y;

        ctx.save();
        ctx.setTransform(1, 0, 0, 1, 0, 0);

        // Do the scoreboard calculation now to save on checking in the loop
        scoreboardRect = scoreboard.getBoundingClientRect();
        canvasRect = canvas.getBoundingClientRect();
        isPlaying = channel.data.state === "playing" &&
            channel.data.actorsByAuthId[app.user.authId] &&
            channel.data.actorsByAuthId[app.user.authId].state !== "dead";
        isDragon = scoreboardButton.dataset.state === "true";


        // Looping through array backwards so we can remove elements
        // without messing up the loop
        for (var i = particleArray.length - 1; i >= 0; i--) {
            ctx.save();

            var particle = particleArray[i];
            var img = particleImgs[particle.imageId];

            particle.position.x += particle.velocity.x * dt;
            particle.position.y += particle.velocity.y * dt;
            particle.angle += particle.angleV * dt;
            particle.angle %= Math.PI * 2;

            particle.velocity.x += particle_acc * particle.scale - 0.02 * particle.velocity.x;

            // Lower alpha if particle is over prompt or locked letters
            if (isObscuring(particle.position.x, particle.position.y)) {
                particle.alpha = Math.max(0.1, particle.alpha - 0.05);
            }
            else if (particle.alpha < 1) {
                particle.alpha = Math.min(1, particle.alpha + 0.05);
            }

            ctx.globalAlpha = particle.alpha;

            var width = img.width * particle.scale;
            var height = img.height * particle.scale;

            ctx.translate(particle.position.x, particle.position.y);
            ctx.rotate(particle.angle);
            oldDrawImage.apply(ctx, [img, -width/2, -height/2, width, height]);

            var approx_size = particle.scale * 64 * 1.5;

            if (particle.position.y > canvas.height + approx_size ||
                particle.velocity.y < 20) {
                particleArray.splice(i, 1);
            }

            ctx.restore();
        }

        ctx.restore();

        requestAnimationFrame(particleUpdate);
    };

    spawnParticle();
    particleUpdate();

    console.log("NN+: Christmas Theme loaded.");
};
nPlus.waitForLoad(christmas);

};

executeScript("(" + main + ")()");